import React from "react";
import {Grid} from 'semantic-ui-react';

const GridComponent = content => (
    <Grid.Row padded="Vertically">
        <Grid.Column>
           <Grid.Row>
                {content.map(itemToBePlacedInRow => 
                    itemToBePlacedInRow)}
           </Grid.Row>
        </Grid.Column>
    </Grid.Row>
)

export default GridComponent;
